import React from 'react';

const About = () => {
    return (
        <div className="container">
            <h4 className="center">Contact</h4>
            <p>AllStar Cooking has been setting the standard for excellence in culinary education since July 2020. With campuses all over the world, we offer cooking classes for students of all ages. Our primary goal is to provide the world's best professional culinary education and enable our students to succeed and excel in the culinary arts.</p>
        </div>
    )
}

export default About;
